	add("salafism", "{\"term\":\"salafism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Transliteration of Arabic سلفي, meaning \u0026quot;predecessor\u0026quot; or \u0026quot;ancestor.\u0026quot;\u0026lt;ref\u0026gt;[http://muttaqun.com/salafiyyah.html Dawat-us-Salafiyyah (Call of those who preceded us)]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Sunni Islamic movement that takes the pious ancestors, the salaf of the patristic period of early Islam, as exemplary models.\u0026lt;ref\u0026gt;Moosa, Ebrahim. \u0027Ghazali And The Poetics Of Imagination\u0027 ISBN 0-8078-5612-6 p. 21\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("salamander", "{\"term\":\"salamander\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|salamandre}}, from Old french (842-ca. 1400) {{m|fro|salamandre}}, from Latin {{m|la|salamandra}}, from Ancient greek (to 1453) {{m|grc|σαλαμάνδρα}}, of uncertain origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A long, slender, chiefly terrestrial amphibian of the order Caudata, resembling a lizard or a newt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1672\u0027\u0027, \u0027\u0027, 1852, Simon Wilkin (editor), \u0027The Works of Sir Thomas Browne\u0027, Volume 1, [http://books.google.com.au/books?id\u003db8gIAAAAQAAJ\u0026amp;pg\u003dPA292\u0026amp;dq\u003d%22Whereas+it+is+commonly+said+that+a+salamander%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dJLVMU_ezJYG_lQWJs4HwCg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Whereas%20it%20is%20commonly%20said%20that%20a%20salamander%22\u0026amp;f\u003dfalse page 292\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"and most plainly Pierius, whose words in his hieroglyphicks are these: \u0026quot;Whereas it is commonly said that a \u0027\u0027salamander\u0027\u0027 extinguisheth fire, we have found by experience that it is so far from quenching hot coals, that it dyeth immediately therein.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A creature much like a lizard that is resistant to and lives in fire, hence the elemental being of fire\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, w:Peter B. Peter B. Kyne, \u0027The Understanding Heart\u0027, Chapter X\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"“Not a chance, Ranger,” Bob Mason was speaking. “This little cuss is a \u0027\u0027salamander\u0027\u0027. He\u0027s been travelling through fire all day and there isn\u0027t a blister on him. …\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027, John Brand, \u0027Observations on the Popular Antiquities of Great Britain: Chiefly Illustrating the Origin of Our Vulgar and Provincial Customs, Ceremonies, and Superstitions\u0027, Volume 3, page 37\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"quot;There is a vulgar error,\u0026quot; says the author of the Brief Natural History, p. 91, \u0026quot;that a \u0027\u0027salamander\u0027\u0027 lives in the fire. Yet both Galen and Dioscorides refute this opinion; and Mathiolus, in his Commentaries upon Dioscorides, a very famous physician, affirms of them, that by casting of many a \u0027\u0027salamander\u0027\u0027 into the fire for tryal he found it false. The same experiment is likewise avouched by Joubertus.\u0026quot\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A metal utensil with a flat head which is heated and put over a dish to brown the top\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, Richard Daunton-Fear, Penelope Vigar, \u0027Australian Colonial Cookery\u0027 (discussing 19th century cookery), Rigby, 1977, ISBN 0-7270-0187-6, page 4\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027salamander\u0027\u0027, a fairly long metal utensil with a flat rounded head, was left in the fire until red hot and then used to brown the top of a dish without further cooking\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A small broiler, used in professional cookery primarily for browning\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The chef first put the steak under the \u0027\u0027salamander\u0027\u0027 to sear the outside\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"This may comprise sets of burners firing below refractory or metal frets, or surface combustion plaques\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The , of the southern United States\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A large poker\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Solidified material in a furnace hearth\", \"priority\":18}]}, \"synonyms\":{}}");

