	add("salineness", "{\"term\":\"salineness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|saline|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Salinity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1921\u0027\u0027, Matthew B. Kendrick, \u0026quot;Paving Material and Process of Making Same,\u0026quot; Specification of Letters Patent, United States Patent Office, nbr. 1,371,032\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The improved surfacing material, by virtue of the well-known properties of salt incorporated therein, prevents the accumulation of ice or the solidification of moisture upon the pavement, the \u0027\u0027salineness\u0027\u0027 of the sand in the composition or material having a tendency directly to dissolve or melt ice on the pavement\", \"priority\":3}]}, \"synonyms\":{}}");

