	add("saliva", "{\"term\":\"saliva\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"{{borrowing|la|salīva||spittle|lang\u003den}}, of uncertain origin. Perhaps from Proto-indo-european {{m|ine-pro|*salw-}}, {{m|ine-pro|*sal-||dirt, dirty}}, cognate with Old english (ca. 450-1100) \u0027salu\u0027 (dark, dusky) More at {{l|en|sallow}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A clear, slightly alkaline liquid secreted into the mouth by the salivary glands and mucous glands, consisting of water, mucin, protein, and enzymes. It moistens the mouth, lubricates ingested food, and begins the breakdown of starches\", \"priority\":1}]}, \"synonyms\":{}}");

