	add("sally", "{\"term\":\"sally\", \"etymology\":{\"influencers\":[], \"languages\":[\"Danish\", \"English\"], \"text\":\"From English \u0027sally\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"also used as a formal given name\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, w:Doris Doris Lessing, \u0027The Four-Gated City\u0027, Bantam Books (1970), page 114\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She submitted―for what alternative did she have?―to being \u0027\u0027Sally\u0027\u0027 in this family, but she always signed herself, Sarah\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, w:Stephen Stephen King, \u0027Just After Sunset\u0027, Simon and Schuster (2009), ISBN 1416586652, page 8\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Maybe her first name was \u0027\u0027Sally\u0027\u0027, but David thought he would have remembered a name like that; there were so few \u0027\u0027Sallys\u0027\u0027 these days. Now the world belonged to Ambers, Ashleys, and Tiffanys\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A nickname for the Salvation Army\", \"priority\":6}]}, \"synonyms\":{}}");

	add("sallee", "{\"term\":\"sallee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Native Australian name.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various wattles (trees\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of various eucalypts\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, D. J. Boland, M. I. H. Brooker, G. M. Chippendale, N. Hall, B. P. M. Hyland, R.D. Johnston, D. A. Kleinig, M. W. McDonald, J. D. Turner, \u0027Forest Trees of Australia\u0027, CSIRO, %22sallees%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dT6LpJji698\u0026amp;sig\u003dhjxK9DNURCG6rHBlvY2kjdBgqvM\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drpIWUMH1M--wiQe6zYDgCg\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"%22sallees%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 556\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Black \u0027\u0027sallee\u0027\u0027 is most common adjacent to creeks and flats in mountainous, tableland country\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Andrew Bain, Ethan Gelber, \u0027Cycling Australia\u0027, %22sallees%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dvsbjKhJ_Vx\u0026amp;sig\u003dugWIY2llItAEop4ifGoUAIju-Ns\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drpIWUMH1M--wiQe6zYDgCg\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"%22sallees%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 136\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In colder regions, mountain gums and white \u0027\u0027sallees\u0027\u0027 – the beautiful twisted snow gums – occur\", \"priority\":8}]}, \"synonyms\":{}}");

