	add("salmagundi", "{\"term\":\"salmagundi\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"French\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"From French \u0027salmigondis\u0027 (seasoned salt meats) from Middle french (ca. 1400-1600) \u0027salmigondin\u0027 probably related to Middle french (ca. 1400-1600) \u0027salomene\u0027 (hodgepodge of meats or fish cooked in wine) from Old french (842-ca. 1400) \u0027salemine\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A food consisting of chopped meat and pickled herring, with oil, vinegar, pepper, and onions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Hence, any mixture of various ingredients; an olio or medley; a potpourri; a miscellany\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, p. 544\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Partly too it reflected the nature of Revolutionary politics throughout the 1790s, which was invariably a kind of inspired \u0027bricolage\u0027, which involved yoking together a wide range of pre-existent elements into an unanticipated and constantly changing \u0027\u0027salmagundi\u0027\u0027 of political forms\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"date\u003d14 September page\u003dR29|passage\u003dThis is not, however, a mere \u0027\u0027salmagundi\u0027\u0027 of alphabetical arcana\", \"priority\":5}]}, \"synonyms\":{}}");

	add("salmoner", "{\"term\":\"salmoner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|salmon|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who fishes for salmon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Lynne D. Fitzhugh, \u0027The Labradorians: voices from the land of Cain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Early occupants unable to successfully exploit their resources sold out to the Company, which made sure that only the most capable trappers and \u0027\u0027salmoners\u0027\u0027 used or purchased them thereafter\", \"priority\":3}]}, \"synonyms\":{}}");

	add("salol", "{\"term\":\"salol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|salicylic|ol|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Phenyl salicylate; a, odorless, tasteless, white crystalline powder, nearly insoluble in water, but soluble in chloroform, ether, oils, and certain concentrations ofalcohol, which is split up in the intestines into salicylic acid and phenol, and which is used for certain medicinal purposes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, David Cerna, \u0027Notes on the Newer Remedies\u0027 (page 178\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The therapeutic action of alphol is said to be similar to that of \u0027\u0027salol\", \"priority\":3}]}, \"synonyms\":{}}");

	add("salon", "{\"term\":\"salon\", \"etymology\":{\"influencers\":[{},{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Old Church Slavonic\", \"English\", \"French\", \"middle french (ca. 1400-1600)\", \"old high german (ca. 750-1050)\", \"Italian\", \"langobardic\", \"Lithuanian\"], \"text\":\"From French \u0027salon\u0027 (reception room) from Middle french (ca. 1400-1600) from Italian \u0027salone\u0027 (large hall) augmented form of Italian \u0027sala\u0027 (hall) from Langobardic \u0027sala\u0027 (room, house, entrance hall) from Proto-germanic {{m|gem-pro|*salą||dwelling, house, hall}}, from Proto-indo-european {{m|ine-pro|*sel-||human settlement, village, dwelling}}. Cognate with Old high german (ca. 750-1050) \u0027sal\u0027 (room, house, entrance hall) Old english (ca. 450-1100) \u0027sæl\u0027 (room, hall, castle) Old church slavonic \u0027селó\u0027 (tr\u003dseló) Lithuanian \u0027sala\u0027 (village)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Abraham Bosse Salon de thumb|A 17th century \u0027\u0027salon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a large room, especially one used to receive and entertain guest\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a gathering of people for a social or intellectual meetin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"an art galler\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a beauty salon or similar establishment\", \"priority\":5}]}, \"synonyms\":{}}");

	add("saloon", "{\"term\":\"saloon\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"French\", \"Proto-Germanic\", \"old high german (ca. 750-1050)\"], \"text\":\"French \u0027salon\u0027 either augmentative of \u0027salle\u0027 (room) or borrowed from Italian \u0027salone\u0027 (hall) augmentative form of \u0027sala\u0027 \u0027salla\u0027 (room) in both cases borrowed from a Proto-germanic source such as Old high german (ca. 750-1050) \u0027sal\u0027 (house, hall) from Proto-germanic {{m|gem-pro|*salą}}, from Proto-indo-european {{m|ine-pro|*sol-}}, derived from {{m|ine-pro|*sel-||dwelling}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tavern, especially in an American Old West setting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A lounge bar in an English public house, contrasted with the public bar\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A pint of beer in the \u0027\u0027saloon\u0027\u0027 bar costs a penny more than in the public bar\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The most common body style for modern cars, with a boot or trunk\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The cabin area of a boat or yacht devoted to seated relaxation, often combined with dining table\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"the part of a rail carriage or multiple unit containing seating for passengers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"living room in a house\", \"priority\":7}]}, \"synonyms\":{}}");

