	add("saltire", "{\"term\":\"saltire\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027saultoir\u0027 (compare French \u0027sautoir\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ordinary (geometric design) in the shape of an X. It usually occupies the entire field in which it is placed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Saint Andrew\u0027s cross, the flag of Scotlan\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Ian Jack, \u0026quot;[http://www.theguardian.com/politics/commentisfree/2014/sep/16/-sp-is-this-the-end-of-britishness Is this the end of Britishness]\u0026quot;, \u0027The Guardian\u0027, 16 September 2014\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It was early August. In the Borders, there were few signs yet of a campaign that could take Scotland out of the United Kingdom. A large Y-E-S hung in separate letters from a tree on the road from Coldstream to Kelso. There wasn’t a N-O to match it, but Kelso town hall flew both the \u0027\u0027saltire\u0027\u0027 and the union jack\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Image:St Patrick\u0027s thumb|St. Patrick\u0027s Cross, a red saltire on a white background\", \"priority\":5}]}, \"synonyms\":{}}");

