	add("salute", "{\"term\":\"salute\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"from Latin \u0027salutare\u0027 (to greet; to wish health to) from \u0027salutis\u0027 genitive of \u0027salus\u0027 (greeting, good health) related to \u0027salvus\u0027 (safe)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A formal gesture made in honor of someone or something, usually with the hand or hands in one of various particular positions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The soldiers greeted the dignitaries with a crisp \u0027\u0027salute\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Simonetta Falasca-Zamponi, \u0027Fascist Spectacle: The Aesthetics of Power in Mussolini\u0027s Italy\u0027, [http://books.google.com.au/books?id\u003d6Cja8Dy7fPUC\u0026amp;pg\u003dPA110\u0026amp;dq\u003d%22+salute%22%7C%22salutes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dspTeUfGrBoPqiAfA5YE4\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22%20salute%22%7C%22salutes%22\u0026amp;f\u003dfalse page 110\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Roman \u0027\u0027salute\u0027\u0027, in which the right arm was raised in a straight and perpendicular manner, had been adopted by D\u0027Annunzio during his regency in Fiume. Like other rituals utilized by D\u0027Annunzio, the \u0027\u0027salute\u0027\u0027 became part of the rising fascist movement\u0027s symbolic patrimony and was inherited by Mussolini\u0027s government\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Tilman Allert, \u0027The Hitler \u0027\u0027Salute\u0027\u0027: On the Meaning of a Gesture\u0027, [http://books.google.com.au/books?id\u003d-1ZtJg_PI70C\u0026amp;pg\u003dPA46\u0026amp;dq\u003d%22+salute%22%7C%22salutes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dspTeUfGrBoPqiAfA5YE4\u0026amp;redir_esc\u003dy page 46\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Like lines of perspective or the beams of searchlights at Nazi Party rallies that shone into the night sky where they met in an infinitely distant beyond, the arms and hands of those giving each other the Hitler \u0027\u0027salute\u0027\u0027 forever approached each other but never joined\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Adrian Tchaikovsky, \u0027Salute the Dark: Shadows of the Apt 4\u0027, [http://books.google.com.au/books?id\u003dhhscFUfIKdUC\u0026amp;pg\u003dPT473\u0026amp;dq\u003d%22+salute%22%7C%22salutes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dspTeUfGrBoPqiAfA5YE4\u0026amp;redir_esc\u003dy unnumbered page\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"And Kaszaat let out a shriek of pure anger, bursting forwards suddenly, flinging her hand up towards Drephos as though in \u0027\u0027salute\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Any action performed for the purpose of honor or tribute\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The orchestra performed the concert as a \u0027\u0027salute\u0027\u0027 to Gershwin\", \"priority\":11}]}, \"synonyms\":{}}");

